import {Link} from "react-router-dom";

export default function Header() {
    return (
        <>
            <header>
                <div className={"header-wrap"}>
                    <h1>꽁냥</h1>
                </div>
            </header>

            <header>
                <div className={"header-wrap"}>
                    <Link to={"#"}>뒤로가기</Link>
                    <h1>꽁냥</h1>
                </div>
            </header>
        </>
    );
}
